@namespace
class SpriteKind:
    Floor = SpriteKind.create()
    Hazard = SpriteKind.create()
    End = SpriteKind.create()

def on_a_pressed():
    if mySprite.vy == 0:
        mySprite.vy = -150
controller.A.on_event(ControllerButtonEvent.PRESSED, on_a_pressed)

def on_combos_attach_combo():
    if mySprite.vy == 0:
        mySprite.vy = -800
controller.combos.attach_combo("" + controller.combos.id_to_string(controller.combos.ID.UP) + controller.combos.id_to_string(controller.combos.ID.UP) + controller.combos.id_to_string(controller.combos.ID.A) + controller.combos.id_to_string(controller.combos.ID.DOWN),
    on_combos_attach_combo)

def on_combos_attach_combo2():
    mySprite.start_effect(effects.trail)
controller.combos.attach_combo("" + controller.combos.id_to_string(controller.combos.ID.A) + controller.combos.id_to_string(controller.combos.ID.B) + controller.combos.id_to_string(controller.combos.ID.A) + controller.combos.id_to_string(controller.combos.ID.B),
    on_combos_attach_combo2)

def on_on_overlap(sprite, otherSprite):
    game.over(False, effects.melt)
sprites.on_overlap(SpriteKind.player, SpriteKind.Hazard, on_on_overlap)

